import React, { Component } from 'react';
import CarouselPage from './Carousel'
import Col from 'react-bootstrap/Col';

class HomePage extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (

            <Col style={{borderColor:"white"}} xs={8}>
                <CarouselPage />
            </Col>
        );
    }
};

export default HomePage;
